import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';


const App = () => {
  const baseUrl = 'https://jsonplaceholder.typicode.com/todos/1';

  const [data, setData] = useState({ data });

  useEffect(() => {
    axios.get(baseUrl)
      .then(res => {
        console.log(res);
        setData(res.data.title);
      });
  }, []);


  return (
    <div className="App">
      <button>
        Click Me
      </button>
      {data}
    </div>
  );
};

export default App;
